import React from 'react';


function DigitalClock(props){
    return(
        <h1>{props.newTime}</h1>
    );
}


const Button = () => {

    return(
        <>
        <DigitalClock newTime={new Date().toLocaleTimeString()}/>
        </>
    );
}

export default Button;
